import React from 'react';
import PropTypes from 'prop-types';
import '../CSS/inputs.css'

function HeightAndWidth({ handleFunctions }) {
  const {
    handleHeight,
    handleWidth,
    height,
    width
  } = handleFunctions;

  return(
    <div className="inputs-container">
      <label
        htmlFor="height"
        className="form-label"
      >
      ALTURA
      <input
        type="number"
        id="height"
        placeholder="centímetros"
        className="form-control"
        value={ height }
        onChange={ handleHeight }
      />
      </label>
      <label htmlFor="width">
        LARGURA
        <input
          type="number"
          id="width"
          placeholder="centímetros"
          className="form-control"
          value={ width }
          onChange={ handleWidth }
        />
      </label>
    </div>
  );
}

HeightAndWidth.propTypes = {
  handleFunctions: PropTypes.objectOf(PropTypes.shape({
    handleHeight: PropTypes.func,
    handleWidth: PropTypes.func,
  })).isRequired,
};

export default HeightAndWidth;
